import React from 'react';
import '../../App.css';
import Footer from '../Footer';
import HeroSection from '../Herosection';
import Navbar from '../Navbar';

function Home() {
  return (
    <>
      <Navbar
      NavButtonName='Register'
      NavButtonlink='/registration'
      NavButtonName2='Login'
      NavButtonlink2='/login'/>
      <HeroSection/>
      <Footer/>
    </>
  );
}

export default Home;
